import React from "react";
import "./Chessboard.css";

let x = ["a", "b", "c", "d", "e", "f", "g", "h"];
let y = ["1", "2", "3", "4", "5", "6", "7", "8"];
const Chessboard = () => {
  let board = [];
  let i, j;

  for (i = 0; i <= 7; i++) {
    for (j = 0; j <= 7; j++) {
        board.push(<div className="tiles">{x[i]}{y[j]}</div>)
    }
  }
  return <div id="chessboard">{board}</div>;
};

export default Chessboard;
